INSERT INTO `news` VALUES (1,1,'TẾT CANH TÝ : BUÔN MÊ THUỘT – KON TUM _ MÙNG 2,4,6','<p>GIÁ VÉ BAO GỒM: Xe đời mới đưa đón khách đi theo chương trình tour. Khách sạn (1 phòng/2, 3 khách). Buôn Mê Thuột : DAKRUCO, BẠCH MÃ Hoặc HỒ LĂK Măng Đen : HOA SIM, HOA SỨ, HOA HỒNG ( Hoặc khách sạn tương đương ) Ăn uống theo chương trình, được đổi món thường xuyên theo ẩm thực địa phương. Hướng dẫn viên thuyết minh và phục vụ cho đoàn suốt tuyến. Vé tham quan vào cửa các thắng cảnh. Khăn lạnh, nước suối trên đường (1 khăn, 1 chai/ ngày). Bảo hiểm du lịch theo qui định bảo hiểm Việt Nam với mức tối đa là 60.000.000 vnđ/trường hợp. GIÁ VÉ KHÔNG BAO GỒM: Chương trình giao lưu văn hóa Tây Nguyên. Cưỡi voi , bơi thuyền độc mộc . Các chương trình vui chơi giải trí cá nhân, các chi phí ăn uống ngoài chương trình GIÁ VÉ TRẺ EM: Quý khách từ 11 tuổi trở lên mua 01 vé. Trẻ em từ 06 đến 10 tuổi mua 1/2 vé. Trẻ em từ 05 tuổi trở xuống: Không tính vé, gia đình tự lo cho bé. Nhưng 02 người lớn chỉ được kèm 01 trẻ em, từ em thứ 02 trở lên phải mua 1/2 vé. (Tiêu chuẩn 1/2 vé: được 01 suất ăn + 01 ghế ngồi và ngủ ghép chung phòng với gia đình). ĐIỀU KIỆN DỜI CHUYỂN HOẶC HỦY TOUR : Chuyển qua tour khác hoặc hủy tour : Trước ngày khởi hành : 15 ngày .Qúy khách không bị mất phí tour . Trước ngày khởi hàng : 10-14 ngày . Qúy khách chịu mất phí tour : 20% trên tổng giá trị tour . Trước ngày khởi hàng : 4 9 ngày . Qúy khách chịu mất phí tour :50% trên tổng giá trị tour . Trước ngày khởi hành : 1 3 ngày . Qúy khách chịu mất phí tour : 100% trên tổng tiền tour . Lưu ý : Tour có vé máy bay , tàu hỏa , tàu thủy Qúy khách sẽ chịu thêm phí theo qui định của hãng hàng không và hãng tàu . Thời gian đổi / hủy được tính theo ngày làm việc, không tính thứ 7 , chủ nhật hoặc ngày Lễ ,Tết</p>','image/23aa63c2978c4ea776273554a45c1805.jpeg','TẾT CANH TÝ BUÔN MÊ THUỘT – PLEIKU -KON TUM THÁC DRAYSAP – BUÔN ĐÔN – CHÙA KHẢI ĐOAN BIỂN HỒ TƠ NƯNG -THỦY ĐIỆN YALY – THÁC PA...',1,1,'2021-03-04 15:53:16',NULL),(2,1,'TẾT CANH TÝ : HUẾ _ MÙNG 2','<p>GIÁ VÉ BAO GỒM : Xe đời mới, đưa đón khách đi theo chương trình trong tour . Khách sạn (phòng 2 ,3 khách) Khách sạn 3 sao: (Hoặc các khách sạn tương đương) Đà Nẵng : HOÀNG ĐẠI 2 , KAY Huế: DUY TÂN 2, THANH LỊCH Khách sạn 4 sao: (Hoặc các khách sạn tương đương ) Đà Nẵng : MƯỜNG THANH ĐÀ NẴNG , GREEN PLAZA Huế: PARVIEW , CHERISH HUẾ , Ăn uống theo chương trình, được đổi món thường xuyên theo ẩm thực địa phương. Hướng dẫn viên thuyết minh và phục vụ cho đoàn suốt tuyến. Vé vào cửa các thắng cảnh. Khăn lạnh, nước suối trên đường (1 khăn, 2 chai/ ngày). Bảo hiểm du lịch theo luật bảo hiểm Việt Nam với mức tối đa là 60.000.000 vnđ/trường hợp. GIÁ VÉ KHÔNG BAO GỒM : Phí tham gia tour mở Bà Nà, thang máy lên Ngũ Hành Sơn . Ăn uống ngoài chương trình, các chi phí tắm biển, vui chơi giải trí cá nhân. Vé máy bay khứ hồi: Sài Gòn – Đà Nẵng; Huế (Đà Nẵng) – Sài Gòn.</p>','image/08b352b7d804f56cfd61b8353269cfb8.jpeg','TẾT CANH TÝ – ĐÀ NẴNG – HỘI AN – HUẾ – ĐỘNG THIÊN ĐƯỜNG —*—*—*— Ngũ Hành Sơn  – Phố cổ Hội An Bà Nà Hill – Cây...',1,1,'2021-03-04 15:55:38',NULL),(3,2,'DU LỊCH MÙA HÈ TRÀNG AN – BÁI ĐÍNH – HÀ NỘI, TOUR 6 NGÀY 5 ĐÊM XUẤT PHÁT TỪ BIÊN HÒA','<p>Hà Nội – Yên Tử – Hạ Long – Chùa Bái Đính – Tràng An – Sapa – Bản Cát Cát – Đỉnh Fansipan Cách Hà Nội khoảng 100km, Ninh Bình được đánh giá là mảnh đất có nhiều điểm đến hấp dẫn cho du khách khám phá trong hè 2019. Đến tour Ninh bình mùa hè, du khách sẽ được khám phá một trong những điểm du lịch hấp dẫn nhất của miền Bắc, nơi đây là sự kết hợp hài hòa giữa cảnh quan thiên nhiên tuyệt đẹp với những công trình kiến trúc lịch sử lâu đời. Với tour du lịch Ninh Bình hè giá rẻ, Quý khách sẽ được đến thăm quan những danh thắng đẹp nổi tiếng ở Ninh Bình như Khu núi chùa Bái Đính nổi tiếng bởi 5 cái nhất: chuông to nhất, nhiều tượng La Hán nhất, chùa lớn nhất, tượng phật to nhất, khuôn viên rộng nhất. Khu du lịch Tràng An nơi vừa được nhận bằng di sản văn hóa và thiên nhiên thế giới của UNESCO với phong cảnh sơn thủy hữu tình, non xanh nước biếc sẽ làm hài lòng quý khách. Điểm du lịch hè Ninh Bình Tràng An được xem là thắng cảnh đẹp nhất của tour du lịch Ninh Bình mùa hè, nơi được ví như một vịnh Hạ Long trên cạn với những dãy núi đá vôi hùng vĩ và các cánh rừng nguyên sinh rậm rạp. Du khách sẽ lên thuyền xuyên qua những vùng đất ngập nước, len lỏi trong các hang động kì vĩ nơi đây. Tour tam cốc – bích động mùa hè 2019 đưa du khách đến với mảnh đất được mệnh danh là Nam thiên đệ nhị động, cùng với Tam Cốc nó hợp thành một quần thể thắng cảnh tuyệt đẹp của hệ thống núi đá vôi và các di tích lịch sử liên quan đến hàng cung Vũ Lâm của triều đại nhà Trần. Hành trình trên dòng sông Ngô Đồng xuyên qua Tam Cốc thực sự sẽ khiến du khách ngỡ ngàng và sửng sốt với cảnh đẹp nơi đây. Đầm Vân Long thuộc địa phận xã Gia Vân, huyện Gia Viễn, đây không phải là đầm nước tự nhiên mà nó được tạo nên từ việc đắp tuyến đê dài hơn 30km ở phía tả ngạn con sông Đáy. Với diện tích hơn 3000ha thì Vân Long đã trở thành khu bảo tồn thiên nhiên ngập nước lớn nhất ở phía Bắc với hệ động thực vật đa dạng và phong phú…Đầm Vân Long cuãng là một điểm du lịch hấp đẫn của tour mùa hè 2019 Ninh Bình Cố đô Hoa L</p>','image/c1330056b36990c6cc817cc9da81117a.jpeg','Hà Nội – Yên Tử – Hạ Long – Chùa Bái Đính – Tràng An – Sapa – Bản Cát Cát – Đỉnh Fansipan Cách Hà Nội khoảng 100km,...',1,1,'2021-03-11 15:50:39',NULL),(4,2,'TOUR DU LỊCH BÀ NÀ – HUẾ – PHONG NHA TRONG 3 NGÀY 2 ĐÊM','<p>NGÀY 1: BÀ NÀ – LĂNG KHẢI ĐỊNH – HUẾ (Ăn sáng, trưa, tối ) Sáng: Đón quý khách tại Đà Nẵng (Sân bay, Ga, điểm hẹn trung tâm) từ 06h30 đến 07h00 (Sau thời gian này, quý khách tự túc nhập đoàn). Khởi hành đi Bà Nà – Núi Chúa(Vé cáp treo Bà Nà tự túc), nơi có những khoảnh khoắc giao mùa bất ngờ Xuân – Hạ – Thu – Đôngtrong một ngày. Qúy khách sẽ tận hưởng cảm giác bồng bền khi ngồi trên Cabin lơ lững giữa chừng mây. Viếng chùa Linh Ưng với tượng Phật Thích Ca cao 27m, viếng đền thờ Bà Chúa Mẫu Thượng Ngàn. Tham gia vui chơi tại công viên Fantasy Parkvới các trò chơi phiêu lưu mới lạ như: Vòng Quay Tình Yêu, Phi Công Skiver, Đường Đua Lửa, Ngôi Nhà Ma và Khu trưng bày hơn 40 tượng sáp – Là những nhân vật nổi tiếng trên thế giới… Trưa: Ăn trưa nhà hàng. Chiều: Khởi hành đi Cố Đô Huế – Di sản văn hoá Thế Giới, xuyên hầm đường bộ đèo Hải Vân, dừng chân tại làng chài Lăng Cô chụp hình lưu niệm.Tham quan Lăng Khải Định – công trình mang nhiều trường phái kiến trúc khác nhau, kết hợp Đông -Tây,Âu – Á, Cổ Kim độc đáo so với các công trình kiến trúc truyền thống Việt Nam. Nhận phòng khách sạn 4* nghỉ ngơi. Tối: Ăn tối nhà hàng với đặc sản xứ Huế(Bánh bèo, lọc, nậm, khoái,…). Quý khách xuống thuyền Rồng để thưởng thức Ca Huế trên sông Hương – nét văn hóa độc đáo của xứ Huế NGÀY 2:HUẾ – THÁNH ĐỊA LA VANG – ĐỘNG PHONG NHA (Ăn sáng, trưa, tối) Sáng: Điểm tâm sớm. Rời Huế đi Phong Nha – Kẻ Bàng.Viếng thăm Thánh Địa La Vang(Được phong tặng là Tiểu Vương Cung Thánh Đường) và ngang qua Vĩ tuyến 17 Sông Bến Hải – Cầu Hiền Lương huyền thoại. Trưa: Ăn trưa nhà hàng tại Phong Nha. Chiều: Ngồi thuyền ngược sông Son chinh phục Động Phong Nha: Cô Tiên &amp; Cung Đình dưới sâu lòng núi nơi có con sông ngầm từ Lào chảy sang, chiêm ngưỡng các khối thạch nhũ tuyệt đẹp được kiến tạo bởi thiên nhiên qua hàng ngàn thiên niên kỷ.Khởi hành về Huế theo đường Trường Sơn – Hồ Chí Minh. Tối: Ăn tối nhà hàng, tự do khám phá Cố Đô về đêm với cầu Tràng Tiền rực rỡ soi mình xuống dòng sông Hương thơ mộng, dạo chơi</p>','image/de017613878df279c89409d98dcfd970.jpeg','NGÀY 1: BÀ NÀ – LĂNG KHẢI ĐỊNH – HUẾ (Ăn sáng, trưa, tối ) Sáng: Đón quý khách tại Đà Nẵng (Sân bay, Ga, điểm hẹn trung tâm)...\n \n ',2,1,'2021-03-11 15:52:05',NULL),(5,3,'TOUR DU LỊCH HUẾ – ĐÀ NẴNG- SƠN TRÀ- NGŨ HÀNH SƠN- HỘI AN – BÀ NÀ HILL 3N2Đ','<p>Ngày 01: Huế city tour ( Ăn trưa, tối) Sáng: Xe và Hướng dẫn viên đón khách tại sân bay lên nhận phòng khách sạn. Trưa: Buffet 50 món tự chọn.(Gồm: món ăn Huế, các món ăn Âu và Á. Quý khách có thể chọn những món chay hoặc món mặn phù hợp khẩu vị riêng Chiều: Xe tiếp tục đưa quý khách tham quan: Đại Nội, Chùa Thiên Mụ. Quý khách tiếp tục lên Thuyền Rồng tham quan,chiêm ngưỡng khung cảnh mặt trời lặn hòa quyện cùng những cảnh đẹp thơ mộng của dòng song Hương trên đường về. Tối: Ăn tối tại khách sạn. Quý khách tự do khám phá Huế về đêm. (Quý khách có thể thuê xích lô đi dạo quanh thành phố Huế để cảm nhận nét yên bình ở đây. Hoặc có thể đi tham quan mua sắm ở khu Phố đêm Huế). Ngày 02: Huế – Đà Nẵng – Ngũ Hành Sơn – Hội An ( Ăn sáng, trưa, tối) Sáng: Ăn sáng, làm thủ tục trả phòng. 5h45 – 6h xe đón quý khách tại khách sạn hoặc nhà văn hóa trung tâm thành phố Huế ( 43A Hùng Vương – Tp Huế) khởi hành đi Đà Nẵng ( Quý khách ăn nhẹ bánh ngọt trên xe). 8h15 đến Đà Nẵng quý khách nghỉ ngơi tại nhà hàng cà phê Sun Ocean, thưởng thức đặt sản Đà Nẵng ( Bún chả cá hoặc mì Quảng Đà Nẵng), ngắm toàn cảnh vịnh Đà Nẵng vào buổi sáng. 9h xe đưa quý khách tham quan Ngũ Hành Sơn – Quý khách chinh phuc 108 bật tam cấp ở ngọn Thủy Sơn để đến tham quan chùa Linh Ứng , ngôi cổ tử được vua Minh Mạng cho xây dựng. Tham quan Tháp Xá Lợi, Vọng Hải Đài, Vọng Giang Đài, chùa Tam Thai, động Tàng Chơn, động Hoa Nghiêm, Động Huyền Không… Tiếp tục tham quan làng Đá mỹ nghệ Non Nước, 1 làng nghề truyền thống gần 300 năm tại Đà Nẵng. Chiêm ngưỡng những tuyệt tác từ Đá do những bàn tay nghệ nhân khéo léo đẽo gọt: Tượng Phật, Kỳ Lân, Sư Tử, Tỳ Hưu… 11h khởi hành về Hội An. Ăn trưa tại nhà hàng với đặc sản Hội An. Chiều: 13h30 quý khách bách bộ tham quan Phố Cổ Hội An gồm: Chùa Cầu Nhật Bản, Hội Quán Phước Kiến, Xưởng thủ công mỹ nghệ .. tự do mua sắm tại phố cổ. ( Mỗi vé tham quan chỉ tham quan được 3 điểm trong tổng 22 điểm tham quan tại phố cổ Hội An). 15h45 xe đón quý khách khởi hành về Đà Nẵng. Nhận</p>','image/4c7b15dd6c6b60ab29c76422fd71ea68.jpeg','Ngày 01: Huế city tour ( Ăn trưa, tối) Sáng: Xe và Hướng dẫn viên đón khách tại sân bay lên nhận phòng khách sạn. Trưa: Buffet 50 món...',1,1,'2021-03-11 16:08:42',NULL),(6,3,'DỊP LỄ 30/4 KHIÊN NGAY COMBO DU LỊCH ĐẢO LÝ SƠN 2N1Đ GIÁ CHỈ 799.000Đ','<p>Lý Sơn – Khó có từ nào miêu tả được hết vẻ đẹp nơi đây, chỉ có thể đến tận mắt và chiêm ngưỡng sự hùng vĩ nhưng bình dị và thuần khiết của một trong những hòn đảo thiêng liêng Tổ quốc. Bên cạnh vẻ đẹp tự nhiên của những con sóng, những ngọn núi, những người lao động cần cù thì Lý Sơn còn toát lên vẻ đẹp của người dân nơi đây vẫn đang lênh đênh trên những con thuyền nơi hải đảo xa xôi, nơi những người dân còn khó khăn, thiếu thốn, vẫn ngày đêm bám biển, ra khơi. Nhà nghỉ Thanh Châu – tọa lạc tại Thôn Tây – Xã An Vĩnh – Huyện Lý Sơn- Quảng Ngãi. Đây Là Nhà Nghỉ bình dân tuy nhiên chất lượng phòng đạt tiêu chuẩn 2 sao được khách hàng đánh giá cao về chất lượng cũng như phong cách phục vụ. là điểm dừng chân nghỉ ngơi, của những khách du lịch gia đình và tập thể. Qúy khách đến Nhà nghỉ Thanh Châu sẽ được chiêm ngưỡng không gian thật tuyệt vời, thoáng mát, có mạng internet Wifi, đầy đủ tiện nghi, không gian rộng, sạch sẽ, phòng vệ sinh khép kín, đồng thời Qúy khách có một không gian ngắm cảnh lúc buổi sáng tinh mơ hay buổi hoàng hôn ngã xuống hòa nguyện vào con sóng của biển, quý khách lắng nghe tiếng rì rào và ngắm nhìn những con tàu ngư dân lượn mình qua con sóng biếc. COMBO DU LỊCH 2 NGÀY 1 ĐÊM TẠI LÝ SƠN BAO GỒM: Vé tàu cao tốc khứ hồi Sa Kỳ – Lý Sơn – Sa Kỳ. Nhân viên tàu sẽ đưa bạn ra tận tàu luôn nhé !!! Một đêm phòng nghỉ tại Thanh Châu (tương đương khách sạn 2 sao đầy đủ tiện nghi) anh chủ nhà nghỉ sẽ đón các bạn ngay khi xuống tàu. Xe máy bao xăng trong 2 ngày Combo 2 ngày 1 đêm: 799.000đ/khách Combo 3 ngày 2 đêm: 990.000đ/khách</p>','image/ba21a120e00df334354c5354a7d7f943.jpeg','Lý Sơn – Khó có từ nào miêu tả được hết vẻ đẹp nơi đây, chỉ có thể đến tận mắt và chiêm ngưỡng sự hùng vĩ nhưng bình dị và...',1,1,'2021-03-11 16:09:56',NULL),(12,2,'Ohotour','<p>xin chào</p>','image/51e7e87e22f965741930349563f6e029.jpeg','xin chào',3,1,'2021-08-17 07:53:46',NULL),(13,2,'oho','<p>12345679qqwertyuiopa