CREATE TABLE `order` (
  `id` int NOT NULL AUTO_INCREMENT,
  `service_id` int NOT NULL,
  `customer_id` int NOT NULL,
  `sale_id` int DEFAULT NULL,
  `adult` int DEFAULT '0',
  `children` int DEFAULT '0',
  `note` text,
  `status` int NOT NULL DEFAULT '1',
  `price` int NOT NULL DEFAULT '0',
  `checkin_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `checkout_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `is_active` int NOT NULL DEFAULT '1',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `customer_name` text,
  `customer_phone` text,
  `customer_address` text,
  `code` text,
  `payment_status` int NOT NULL DEFAULT '1',
  `sale_leader_id` int DEFAULT NULL,
  `use_point` int NOT NULL DEFAULT '0',
  `start_payment_at` datetime DEFAULT NULL,
  `end_payment_at` datetime DEFAULT NULL,
  `profit` int DEFAULT '0',
  `is_request_payment` int NOT NULL DEFAULT '0',
  `payment_provider_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `service_id` (`service_id`),
  KEY `customer_id` (`customer_id`),
  KEY `sale_id` (`sale_id`),
  KEY `sale_leader_id` (`sale_leader_id`),
  CONSTRAINT `order_ibfk_320` FOREIGN KEY (`service_id`) REFERENCES `service` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `order_ibfk_321` FOREIGN KEY (`customer_id`) REFERENCES `user` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `order_ibfk_322` FOREIGN KEY (`sale_id`) REFERENCES `user` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `order_ibfk_323` FOREIGN KEY (`sale_leader_id`) REFERENCES `user` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=180 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
