INSERT INTO `regions` VALUES (1,'Tây Bắc','image/c2e607c88202caa4e9b8b9b0c7360e60.jpeg','Vùng Tây Bắc là vùng miền núi phía tây của miền Bắc Việt Nam, gồm 6 tỉnh Hòa Bình, Sơn La, Điện Biên, Lai Châu, Lào Cai, Yên Bái, có chung đường biên giới với Lào và Trung Quốc. Đến du lịch Tây Bắc du khách sẽ không khỏi nạc nhiên trước khung cảnh vùng núi trập trùng đẹp như tranh, trước cuộc sống của người dân vùng cao vẫn còn chút gì đó hoang sơ nhưng thật bình yên, êm ả.',1),(2,'Đông Bắc','image/36cfd3fbad796fa2a55c47316204fe05.jpeg','Được thiên nhiên ưu đãi với cảnh quan thiên nhiên tuyệt đẹp của núi, thung lũng, thác nước và rừng mưa, du lịch Đông Bắc Việt Nam là điểm đến lý tưởng cho hành trình trải nghiệm những điều mới mẻ. Theo chân kinh nghiệm du lịch Đông Bắc tự túc tham gia vào các hoạt động thú vị chỉ có ở vùng Đông Bắc và ngắm nhìn vẻ đẹp hùng vĩ của núi rừng Đông Bắc.',1),(3,'Đồng bằng sông Hồng','image/73e4ce92c19c559a125056da0d1000e4.jpeg','Đồng bằng sông Hồng  là một vùng đất rộng lớn nằm quanh khu vực hạ lưu sông Hồng thuộc miền Bắc Việt Nam, vùng đất bao gồm 10 tỉnh và thành phố như: Bắc Ninh, Hà Nam, Hà Nội, Hải Dương, Hải Phòng, Hưng Yên, Nam Định, Ninh Bình, Thái Bình và Vĩnh Phúc.',1),(4,'Bắc Trung Bộ','image/22ea7ffa0e46292fe2516ca2ac7db4dc.jpeg','Bắc Trung Bộ nằm gọn trên dải đất hẹp nhất của Việt Nam, giữa một bên là dãy Trường Sơn hùng vĩ, một bên là biển Đông mênh mông. Với đường bờ biển dài cùng nhiều cửa khẩu giáp với Lào, khu vực này có vị trí đặc biệt quan trọng trong phát triển kinh tế - du lịch giữa Việt Nam với các nước trong khu vực trên hành lang Đông - Tây.',1),(5,'Nam Trung Bộ','image/8cd40bc6e6e6e8185c2af0ad22dd4b5d.jpeg','Vùng Duyên hải Nam Trung Bộ tiếp giáp Đông Nam Bộ ở phía nam thuận lợi trong giao lưu phát triển kinh tế chịu ảnh hưởng mạnh mẽ của Đông Nam Bộ trong quá trình phát triển giáp với Tây Nguyên và là cửa ngõ ra biển của Tây Nguyên, Campuchia, Thái Lan, thuận lợi giao lưu phát triển kinh tế và hình thành nền kinh tế mở.',1),(6,'Tây Nguyên','image/e1ffb7f89576f626ff59a8c12a573cfe.jpeg','Khu vực tây Nguyên bao gồm các tỉnh Kon Tum, Gia Lai, Lâm Đồng, Đăk Lăk và Đăk Nông. Đến với vùng Tây Nguyên rộng lớn, du khách không chỉ có dịp chiêm ngưỡngnhững danh lam thắng cảnh tuyệt vời mà còn có cơ hội tham gia vào những trải nghiệm thú vị về cuộc sônngs của đồng bào các dân tộc ít người nơi đây nhưu Ba Na, Ê đê, Gia Rai,…thưởng thức những món ăn đặc sắc mang đậm nét đặc trưng của núi rừng Tây Nguyên. Với khí hậu tương đối dễ chịu, con người thân thiện gần gũi, chắc chắn Tây Nguyên sẽ làm say lòng mỗi du khách khi có dịp đến với nơi đây',1),(7,'Đông Nam Bộ','image/6981feccef002d2e5b7a4d624c42ab81.jpeg','Đến Đông Nam Bộ, du khách có dịp tham quan Thành phố Hồ Chí Minh được ví như “Hòn ngọc Viễn Đông” với lịch sử hơn 300 năm, nơi có nhiều di tích cách mạng, công trình kiến trúc cổ như bến cảng nhà Rồng, địa đạo Củ Chi, dinh Độc Lập, đền Quốc Tổ, dinh Xã Tây, Nhà hát lớn, Bưu điện thành phố hay hệ thống các ngôi chùa cổ: Giác Lâm, Bà Thiên Hậu, Tổ Đình Giác Viên...; các nhà thờ Đức Bà, Huyện Sỹ, Thông Tây Hội, Thủ Đức...; các bảo tàng Chứng tích Chiến tranh, Phụ nữ Nam Bộ, Hồ Chí Minh, Mỹ thuật, Lịch sử Việt Nam',1),(8,'Tây Nam Bộ','image/d7b6bbf8ae4dedabc481141815a837f1.jpeg','Vùng đồng bằng sông Cửu Long là vùng cực Nam của Việt Nam, hay còn gọi là vùng đồng bằng sông Mê Kông, vùng đồng bằng Nam Bộ hoặc miền Tây Nam Bộ hoặc nói ngắn gọn là miền Tây thì người dân Việt Nam cũng có thể hiểu được. Miền Tây Nam Bộ gồm có 12 tỉnh (An Giang, Bạc Liêu, Bến Tre, Cà Mau, Đồng Tháp, Tiền Giang, Sóc Trăng, Long An, Hậu Giang, Kiên Giang, Trà Vinh, Vĩnh Long) và 1 thành phố trực thuộc Trung ương (Cần Thơ). Khác với thời tiết phía Bắc, khi Xuân về, miền Tây vẫn ấm áp với nắng hanh vàng rất thích hợp cho một chuyến du xuân. Asia Holiday Travel xin giới thiệu những nét khái quát về mảnh đất con người miền Tây đến với Quý khách nhân dịp Xuân kỷ hợi 2019.',1);
/*!40000 ALTER TABLE `regions` ENABLE KEYS */;
UNLOCK TABLES;

