INSERT INTO `service` VALUES (1,'Du Lịch Mộc Châu: Hà Nội - Mộc Châu 2 Ngày + Xe Ôtô',4.714285714285714,14,12,'10-20 người','VILLA001','<p>Sáng: Dự kiến 06h00 Hướng dẫn viên đón Quý khách tại sân bay Đà Nẵng, làm thủ tục hỗ trợ Quý khách đáp chuyến bay đi tour du lịch Đà Lạt. Đến sân bay, xe và Hướng dẫn viên đón Quý khách về trung tâm Đà Lạt, tham quan: Nhà thờ Domain De Marie - Nhà thờ được xây dựng theo kiến trúc Pháp, biểu tượng màu hồng trong lòng thành phố Đà Lạt. Đồi Robin (Đồi vọng cảnh) &amp; Ga cáp treo Đà Lạt, Ngọn đồi cao 1500m so với mực nước biển để quý khách có thể ngắm toàn cảnh thành phố Đà Lạt. Có hệ thống cáp treo dài 2300m đưa quý khách thăm ngôi chùa lớn nhất Đà Lạt. Quý khách ngắm toàn cảnh thành phố Đà Lạt xinh đẹp, nếu có nhu cầu quý khách có thể trải nghiệm cáp treo từ đây sang Thiền Viện Trúc Lâm (Tự phí: 80,000đ/1 chiều, 100,000đ/khứ hồi) Green Hill – Địa điểm vàng để có những bức hình lung linh tuyệt đẹp ở Đà Lạt với các cảnh quan: Cổng trời Bali, Cổng thần đạo Nhật Bản, nấc thang lên thiên đường… (Chi phí nước uống vào chụp ảnh quý khách tự thanh toán) Trưa: Quý khách dùng Buffet rau Leguda – nét văn hoá ẩm thực của Đà Lạt. Chiều: Quý khách về khách sạn nghỉ ngơi. Phố bích hoạ Dốc Nhà Làng - Dốc Nhà Làng không còn quá xa lạ với bao thế hệ người dân Đà Lạt cũng như du khách đến đây, nhưng sau hơn nửa thập kỉ, hơn 5 con hẻm nhỏ vô tri vô giác này bỗng được thổi hồn và làm mới mình bởi các nghệ sĩ trẻ tải năng đến từ Phố Bên Đồi. Bạn sẽ bắt gặp những hình ảnh quen thuộc vốn gắn liền với thành phố ngàn hoa bao thập kỉ qua như hình ảnh bác sĩ Yersin – người mà Đà Lạt được vinh dự lấy tên để đặt cho một con đường khá nổi tiếng, hay là trường Trung học Bùi Thị Xuân bên tà áo dài trắng. Thiền Viện Trúc Lâm - Hồ Tuyền Lâm ngôi chùa lớn được xây dựng năm 1993 theo phái Thiền Tông với diện tích rộng 24 hecta cảnh quan đẹp nhìn xuống khu du lịch Hồ Tuyền Lâm. Quý khách có thể đăng kí tham quan Đường hầm đất sét - bằng Đất Sét dài hơn 1km, đường hầm điêu khắc tại hiện lại lịch sử hình thành Đà Lạt từ thuở khai sơ đến hiện đại với một số công trình đặc trưng như : Trường cao đẳng sư phạm, Ga</p>','Đà Nẵng - Đà Lạt - Thành Phố Ngàn Hoa',NULL,NULL,'','0355441109',2,2,37,'không có',1,'2021-03-03 16:19:56',2,1,'<p>Sáng: Dự kiến 06h00 Hướng dẫn viên đón Quý khách tại sân bay Đà Nẵng, làm thủ tục hỗ trợ Quý khách đáp chuyến bay đi tour du lịch Đà Lạt. Đến sân bay, xe và Hướng dẫn viên đón Quý khách về trung tâm Đà Lạt, tham quan: Nhà thờ Domain De Marie - Nhà thờ được xây dựng theo kiến trúc Pháp, biểu tượng màu hồng trong lòng thành phố Đà Lạt. Đồi Robin (Đồi vọng cảnh) &amp; Ga cáp treo Đà Lạt, Ngọn đồi cao 1500m so với mực nước biển để quý khách có thể ngắm toàn cảnh thành phố Đà Lạt. Có hệ thống cáp treo dài 2300m đưa quý khách thăm ngôi chùa lớn nhất Đà Lạt. Quý khách ngắm toàn cảnh thành phố Đà Lạt xinh đẹp, nếu có nhu cầu quý khách có thể trải nghiệm cáp treo từ đây sang Thiền Viện Trúc Lâm (Tự phí: 80,000đ/1 chiều, 100,000đ/khứ hồi) Green Hill – Địa điểm vàng để có những bức hình lung linh tuyệt đẹp ở Đà Lạt với các cảnh quan: Cổng trời Bali, Cổng thần đạo Nhật Bản, nấc thang lên thiên đường… (Chi phí nước uống vào chụp ảnh quý khách tự thanh toán) Trưa: Quý khách dùng Buffet rau Leguda – nét văn hoá ẩm thực của Đà Lạt. Chiều: Quý khách về khách sạn nghỉ ngơi. Phố bích hoạ Dốc Nhà Làng - Dốc Nhà Làng không còn quá xa lạ với bao thế hệ người dân Đà Lạt cũng như du khách đến đây, nhưng sau hơn nửa thập kỉ, hơn 5 con hẻm nhỏ vô tri vô giác này bỗng được thổi hồn và làm mới mình bởi các nghệ sĩ trẻ tải năng đến từ Phố Bên Đồi. Bạn sẽ bắt gặp những hình ảnh quen thuộc vốn gắn liền với thành phố ngàn hoa bao thập kỉ qua như hình ảnh bác sĩ Yersin – người mà Đà Lạt được vinh dự lấy tên để đặt cho một con đường khá nổi tiếng, hay là trường Trung học Bùi Thị Xuân bên tà áo dài trắng. Thiền Viện Trúc Lâm - Hồ Tuyền Lâm ngôi chùa lớn được xây dựng năm 1993 theo phái Thiền Tông với diện tích rộng 24 hecta cảnh quan đẹp nhìn xuống khu du lịch Hồ Tuyền Lâm. Quý khách có thể đăng kí tham quan Đường hầm đất sét - bằng Đất Sét dài hơn 1km, đường hầm điêu khắc tại hiện lại lịch sử hình thành Đà Lạt từ thuở khai sơ đến hiện đại với một số công trình đặc trưng như : Trường cao đẳng sư phạm, Ga</p>'),(2,'NGÀY  01: ĐÀ NẴNG - ĐÀ LẠT (ĂN TRƯA, TỐI)',4.833333333333333,2,3,'10-20 người','VILLA002','<p>Sáng: Dự kiến 06h00 Hướng dẫn viên đón Quý khách tại sân bay Đà Nẵng, làm thủ tục hỗ trợ Quý khách đáp chuyến bay đi tour du lịch Đà Lạt. Đến sân bay, xe và Hướng dẫn viên đón Quý khách về trung tâm Đà Lạt, tham quan: Nhà thờ Domain De Marie - Nhà thờ được xây dựng theo kiến trúc Pháp, biểu tượng màu hồng trong lòng thành phố Đà Lạt. Đồi Robin (Đồi vọng cảnh) &amp; Ga cáp treo Đà Lạt, Ngọn đồi cao 1500m so với mực nước biển để quý khách có thể ngắm toàn cảnh thành phố Đà Lạt. Có hệ thống cáp treo dài 2300m đưa quý khách thăm ngôi chùa lớn nhất Đà Lạt. Quý khách ngắm toàn cảnh thành phố Đà Lạt xinh đẹp, nếu có nhu cầu quý khách có thể trải nghiệm cáp treo từ đây sang Thiền Viện Trúc Lâm (Tự phí: 80,000đ/1 chiều, 100,000đ/khứ hồi) Green Hill – Địa điểm vàng để có những bức hình lung linh tuyệt đẹp ở Đà Lạt với các cảnh quan: Cổng trời Bali, Cổng thần đạo Nhật Bản, nấc thang lên thiên đường… (Chi phí nước uống vào chụp ảnh quý khách tự thanh toán) Trưa: Quý khách dùng Buffet rau Leguda – nét văn hoá ẩm thực của Đà Lạt. Chiều: Quý khách về khách sạn nghỉ ngơi. Phố bích hoạ Dốc Nhà Làng - Dốc Nhà Làng không còn quá xa lạ với bao thế hệ người dân Đà Lạt cũng như du khách đến đây, nhưng sau hơn nửa thập kỉ, hơn 5 con hẻm nhỏ vô tri vô giác này bỗng được thổi hồn và làm mới mình bởi các nghệ sĩ trẻ tải năng đến từ Phố Bên Đồi. Bạn sẽ bắt gặp những hình ảnh quen thuộc vốn gắn liền với thành phố ngàn hoa bao thập kỉ qua như hình ảnh bác sĩ Yersin – người mà Đà Lạt được vinh dự lấy tên để đặt cho một con đường khá nổi tiếng, hay là trường Trung học Bùi Thị Xuân bên tà áo dài trắng. Thiền Viện Trúc Lâm - Hồ Tuyền Lâm ngôi chùa lớn được xây dựng năm 1993 theo phái Thiền Tông với diện tích rộng 24 hecta cảnh quan đẹp nhìn xuống khu du lịch Hồ Tuyền Lâm. Quý khách có thể đăng kí tham quan Đường hầm đất sét - bằng Đất Sét dài hơn 1km, đường hầm điêu khắc tại hiện lại lịch sử hình thành Đà Lạt từ thuở khai sơ đến hiện đại với một số công trình đặc trưng như : Trường cao đẳng sư phạm, Ga</p>','Đà Nẵng - Đà Lạt - Thành Phố Ngàn Hoa',NULL,NULL,'','0355441109',3,497,20302,'không có',1,'2021-03-04 14:34:31',5,1,'<p>Sáng: Dự kiến 06h00 Hướng dẫn viên đón Quý khách tại sân bay Đà Nẵng, làm thủ tục hỗ trợ Quý khách đáp chuyến bay đi tour du lịch Đà Lạt. Đến sân bay, xe và Hướng dẫn viên đón Quý khách về trung tâm Đà Lạt, tham quan: Nhà thờ Domain De Marie - Nhà thờ được xây dựng theo kiến trúc Pháp, biểu tượng màu hồng trong lòng thành phố Đà Lạt. Đồi Robin (Đồi vọng cảnh) &amp; Ga cáp treo Đà Lạt, Ngọn đồi cao 1500m so với mực nước biển để quý khách có thể ngắm toàn cảnh thành phố Đà Lạt. Có hệ thống cáp treo dài 2300m đưa quý khách thăm ngôi chùa lớn nhất Đà Lạt. Quý khách ngắm toàn cảnh thành phố Đà Lạt xinh đẹp, nếu có nhu cầu quý khách có thể trải nghiệm cáp treo từ đây sang Thiền Viện Trúc Lâm (Tự phí: 80,000đ/1 chiều, 100,000đ/khứ hồi) Green Hill – Địa điểm vàng để có những bức hình lung linh tuyệt đẹp ở Đà Lạt với các cảnh quan: Cổng trời Bali, Cổng thần đạo Nhật Bản, nấc thang lên thiên đường… (Chi phí nước uống vào chụp ảnh quý khách tự thanh toán) Trưa: Quý khách dùng Buffet rau Leguda – nét văn hoá ẩm thực của Đà Lạt. Chiều: Quý khách về khách sạn nghỉ ngơi. Phố bích hoạ Dốc Nhà Làng - Dốc Nhà Làng không còn quá xa lạ với bao thế hệ người dân Đà Lạt cũng như du khách đến đây, nhưng sau hơn nửa thập kỉ, hơn 5 con hẻm nhỏ vô tri vô giác này bỗng được thổi hồn và làm mới mình bởi các nghệ sĩ trẻ tải năng đến từ Phố Bên Đồi. Bạn sẽ bắt gặp những hình ảnh quen thuộc vốn gắn liền với thành phố ngàn hoa bao thập kỉ qua như hình ảnh bác sĩ Yersin – người mà Đà Lạt được vinh dự lấy tên để đặt cho một con đường khá nổi tiếng, hay là trường Trung học Bùi Thị Xuân bên tà áo dài trắng. Thiền Viện Trúc Lâm - Hồ Tuyền Lâm ngôi chùa lớn được xây dựng năm 1993 theo phái Thiền Tông với diện tích rộng 24 hecta cảnh quan đẹp nhìn xuống khu du lịch Hồ Tuyền Lâm. Quý khách có thể đăng kí tham quan Đường hầm đất sét - bằng Đất Sét dài hơn 1km, đường hầm điêu khắc tại hiện lại lịch sử hình thành Đà Lạt từ thuở khai sơ đến hiện đại với một số công trình đặc trưng như : Trường cao đẳng sư phạm, Ga</p>'),(3,'Trầm 2-5 ngày',5,NULL,1,'10-20 người','VILLA003','<p>- Vé máy bay khứ hồi TP.HCM – HÀ NỘI – TP.HCM (Vietjet Air). - Xe tham quan (xe 16 chỗ, 29 chỗ, 35 chỗ, 45 chỗ) tùy theo số lượng khách thực tế trên chuyến đi. - Nghỉ đêm tại Mộc Châu, Sơn La, Sapa, Điện Biên: khách sạn tiêu chuẩn tương đương 3 sao, 4 sao đầy đủ tiện nghi. Phòng 2 (2 khách người lớn/ phòng), nếu lẻ người thứ 3, đóng phụ phí phòng đơn hoặc ngủ ghép phòng 3 khách. - Ăn uống theo chương trình: + Ăn phụ: 5 bữa sáng. + Ăn chính: 11 bữa chính. - Vé tham quan theo chương trình. - Hướng dẫn viên tiếng Việt vui vẻ nhiệt tình suốt chuyến đi. - Bảo hiểm với mức bồi thường tối đa 100.000.000 đồng/trường hợp. Không áp dụng cho khách từ 80 tuổi trở lên. - Quà tặng: nón du lịch Việt, nước, khăn lạnh. Không bao gồm: - Bia hay nước ngọt trong các bữa ăn. - Chi phí cá nhân: điện thoại, giặt ủi… - Xe điện tại KDL Đền Hùng, cáp treo Fansipan, vé cầu kính rồng mây … - Các chi phí không có trong mục chi phí bao gồm. - Thuế VAT.</p>','Đà Nẵng - Đà Lạt - Thành Phố Ngàn Hoa',NULL,NULL,'A Tiến','0355441109',3,494,20290,'than, bếp',1,'2021-03-23 14:29:29',5,1,'<p>- Vé máy bay khứ hồi TP.HCM – HÀ NỘI – TP.HCM (Vietjet Air). - Xe tham quan (xe 16 chỗ, 29 chỗ, 35 chỗ, 45 chỗ) tùy theo số lượng khách thực tế trên chuyến đi. - Nghỉ đêm tại Mộc Châu, Sơn La, Sapa, Điện Biên: khách sạn tiêu chuẩn tương đương 3 sao, 4 sao đầy đủ tiện nghi. Phòng 2 (2 khách người lớn/ phòng), nếu lẻ người thứ 3, đóng phụ phí phòng đơn hoặc ngủ ghép phòng 3 khách. - Ăn uống theo chương trình: + Ăn phụ: 5 bữa sáng. + Ăn chính: 11 bữa chính. - Vé tham quan theo chương trình. - Hướng dẫn viên tiếng Việt vui vẻ nhiệt tình suốt chuyến đi. - Bảo hiểm với mức bồi thường tối đa 100.000.000 đồng/trường hợp. Không áp dụng cho khách từ 80 tuổi trở lên. - Quà tặng: nón du lịch Việt, nước, khăn lạnh. Không bao gồm: - Bia hay nước ngọt trong các bữa ăn. - Chi phí cá nhân: điện thoại, giặt ủi… - Xe điện tại KDL Đền Hùng, cáp treo Fansipan, vé cầu kính rồng mây … - Các chi phí không có trong mục chi phí bao gồm. - Thuế VAT.</p>'),(10,'Du lịch Hè - Tour Miền Bắc Hà Nội - Mộc Châu - Sơn La - Điện Biên - Sa Pa - Phú Thọ - Đền Hùng từ Sài Gòn',4,14,12,'20','122112','<p><em style=\"color: rgb(51, 51, 51);\">Giờ bay có thể thay đổi theo quy định của hàng không. Du Lịch Việt sẽ thay đổi chương trình cho phù hợp với giờ bay mới nhưng sẽ không chịu trách nhiệm về các khoản chi phí phát sinh.&nbsp;</em></p><p><em style=\"color: rgb(51, 51, 51);\">(Đoàn tối thiểu 10 khách khởi hành)</em></p><p><strong style=\"color: rgb(51, 51, 51);\">Giá tour bao gồm:</strong></p><p><span style=\"color: rgb(51, 51, 51);\">-&nbsp;&nbsp;&nbsp;Vé máy bay khứ hồi TP.HCM – HÀ NỘI – TP.HCM (Vietjet Air).</span></p><p><span style=\"color: rgb(51, 51, 51);\">-&nbsp;&nbsp;&nbsp;Xe tham quan (xe 16 chỗ, 29 chỗ, 35 chỗ, 45 chỗ) tùy theo số lượng khách thực tế trên chuyến đi.</span></p><p><span style=\"color: rgb(51, 51, 51);\">-&nbsp;&nbsp;&nbsp;Nghỉ đêm tại Mộc Châu, Sơn La, Sapa, Điện Biên: khách sạn tiêu chuẩn tương đương 3 sao, 4 sao đầy đủ tiện nghi. Phòng 2 (2 khách người lớn/ phòng), nếu lẻ người thứ 3, đóng phụ phí phòng đơn hoặc ngủ ghép phòng 3 khách.&nbsp;</span></p><p><span style=\"color: rgb(51, 51, 51);\">-&nbsp;&nbsp;&nbsp;Ăn uống theo chương trình:&nbsp;</span></p><p><span style=\"color: rgb(51, 51, 51);\">&nbsp;&nbsp;&nbsp;+ Ăn phụ: 5 bữa sáng.</span></p><p><span style=\"color: rgb(51, 51, 51);\">&nbsp;&nbsp;&nbsp;+ Ăn chính: 11 bữa chính.</span></p><p><span style=\"color: rgb(51, 51, 51);\">-&nbsp;&nbsp;&nbsp;Vé tham quan theo chương trình.&nbsp;</span></p><p><span style=\"color: rgb(51, 51, 51);\">-&nbsp;&nbsp;&nbsp;Hướng dẫn viên tiếng Việt vui vẻ nhiệt tình suốt chuyến đi.</span></p><p><span style=\"color: rgb(51, 51, 51);\">-&nbsp;&nbsp;&nbsp;Bảo hiểm với mức bồi thường tối đa 100.000.000 đồng/trường hợp. Không áp dụng cho khách từ 80 tuổi trở lên.</span></p><p><span style=\"color: rgb(51, 51, 51);\">-&nbsp;&nbsp;&nbsp;Quà tặng: nón du lịch Việt, nước, khăn lạnh.</span></p><p><strong style=\"color: rgb(51, 51, 51);\">Không bao gồm:</strong></p><p><span style=\"color: rgb(51, 51, 51);\">-&nbsp;&nbsp;&nbsp;Bia hay nước ngọt trong các bữa ăn.</span></p><p><span style=\"color: rgb(51, 51, 51);\">-&nbsp;&nbsp;&nbsp;Chi phí cá nhân: điện thoại, giặt ủi…</span></p><p><span style=\"color: rgb(51, 51, 51);\">-&nbsp;&nbsp;&nbsp;Xe điện tại KDL Đền Hùng, cáp treo Fansipan, vé cầu kính rồng mây …</span></p><p><span style=\"color: rgb(51, 51, 51);\">-&nbsp;&nbsp;&nbsp;Các chi phí không có trong mục chi phí bao gồm.</span></p><p><span style=\"color: rgb(51, 51, 51);\">-&nbsp;&nbsp;&nbsp;Thuế VAT.</span></p>','Ha Noi',NULL,NULL,'','0912312313',2,2,76,'than, bếp, bla',1,'2021-04-01 16:40:12',2,1,'<p class=\"ql-align-justify\"><strong>Sáng:&nbsp;&nbsp;Quý khách có mặt tại ga quốc nội, sân bay Tân Sơn Nhất trước giờ bay ít nhất hai tiếng.</strong></p><ul><li class=\"ql-align-justify\">Đại diện công ty Du Lịch Việt đón và hỗ trợ Quý khách làm thủ tục đón chuyến bay đi Hà Nội.</li><li class=\"ql-align-justify\">Đến sân bay Nội Bài, xe đón Đoàn khởi hành đến Mai Châu.</li><li class=\"ql-align-justify\">Trên đường đến Hòa Bình, Quý khách có dịp ngắm nhìn Nhà máy thủy điện sông Đà (còn gọi là thủy điện Hòa Bình)</li><li class=\"ql-align-justify\">Chiêm ngưỡng toàn cảnh tuyệt đẹp của thung lũng Mai Châu trên đoạn đường đèo Thung Khe.</li></ul><p><strong>Trưa:&nbsp;Dùng cơm trưa.</strong></p><ul><li>Đoàn tiếp tục khởi hành đến Mai Châu, tham quan Bản Lác tìm hiểu phong tục tập quán của bản làng người Thái, nơi in đậm bản sắc văn hóa người Thái.</li><li>Rời Mai Châu, Đoàn khởi hành đến Cao Nguyên Mộc Châu nổi tiếng với những đồi chè xanh mướt trải dài đến tận bên kia quả đồi</li></ul><p><strong>Tối:&nbsp;Dùng cơm chiều.</strong></p><ul><li>Nghỉ đêm Mộc Châu.</li></ul>');
