ình đang chạy khuyến mãi ra mắt thương hiệu:\n?T2-T5: 4.9tr\n?T6+CN: 5.9tr\n?T7: 7.4tr\n?Cọc 60%_Đã đặt rồi không hoàn hủy, ko thay đổi?\n?Đang là thời gian nhạy cảm sau dịch nên không làm ồn sau 10h tối\n?Nhiêm cấm sử dụng bóng cười, ma túy, chất độc và gây cháy nổ trong khuôn viên ..và tất cả các hành vi vi phạm Pháp luật hiện hành. Trường hợp cố tình vi phạm, chúng tôi sẽ mời về và không hoàn lại tiền cho đêm nghỉ, khách nghỉ tại Villa chịu trách nhiệm pháp lý trước cơ quan chức năng và bồi thường thiệt hại kinh tế cho khu nghỉ dưỡng nếu có. Rất mong Quí khách hợp tác và cam kết thực hiện đúng Nội qui.','https://docs.google.com/spreadsheets/d/1d7fh0RU_FkbMrnoFLx76YVkAiwa2BeglK2t1hGIl6DY/edit#gid=697243392','Hs ss Eden_3p_↗16-20ng_(hs Sóc Sơn)',0,0,0,0,0,0,'https://zalo.me/g/bzsrlp583',0,0,0,'',NULL,'lẻ'),(225,'Kinh nghiệm Ba Vì 1*',2,1,0,0,0,'?GỢI Ý CÁC ĐỊA ĐIỂM DU LỊCH NỔI TIẾNG BA VÌ \nhttps://youtube.com/shorts/vsC_TvLu_FU?feature=share\n\nBa Vì là một điểm đến chưa bao giờ hết hot cho chuyến đi du lịch 2 ngày 1 đêm. Nếu bạn đang có dự tính đi chơi Ba Vì thì đừng bỏ qua những Khu du lịch nổi tiếng này nhé:\n1️⃣ VƯỜN QUỐC GIA BA VÌ:\nĐịa chỉ: Tản Lĩnh, Ba Vì, Hà Nội https://goo.gl/maps/n6nECxBL9hCYwYpq6\nKhông những lưu giữ nhiều huyền thoại từ thời lập đất, lập quốc mà còn là một thế giới đại ngàn với hệ thống động thực vật muôn điều kỳ thú.\n2️⃣ LÀNG VĂN HOÁ CÁC DÂN TỘC VIỆT NAM:\nĐịa chỉ: Cổ Đông, Ba Vì, Hà Nội https://goo.gl/maps/BbG4cN3WDsgd5SWV7\nCách Hà Nội hơn 40km, là một phần thuộc khu du lịch Đồng Mô, Sơn Tây, Hà Nội. Nơi đây có địa hình đồi núi đa dạng, sát thung lũng và hồ nước hiền hòa.\n3️⃣ KHOANG XANH-SUỐI TIÊN:\nĐịa chỉ: Khu Du Lịch Khoang Xanh Suối Tiên,Vân Hoà, Ba Vì, Hà Nội. https://goo.gl/maps/WLY7rJc8WJrzM4q29\nCó không gian thoáng mát, nhiều suối thác và nhiều cây xanh giúp quý du khách có phút giây thư thái sau chuỗi ngày bộn bề công việc.\n4️⃣ AO VUA:\nĐịa chỉ: Khu Du Lịch Ao Vua Ba Vì, Hà Nội https://goo.gl/maps/7AUrNU4JYUy4pRKw7\nNằm trải dài dưới chân núi Tản Viên. Nơi đây, bạn sẽ được sống trong không gian văn hóa Việt Nam bao la huyền ảo: Về Hùng Duệ Vương, công chúa Ngọc Hoa, thần Sơn Tinh, Thủy Tinh với cuộc chiến long trời nở đất mãi mãi là truyền thuyết đẹp nhất của người Việt.','','Kn Ba Vì_1_Các điểm du lịch ở Ba Vì',0,0,0,0,0,0,'',0,0,0,'','',NULL),(226,'Kinh nghiệm Ba Vì 2*',2,1,0,0,0,'5️⃣ THIÊN SƠN SUỐI NGÀ:\nĐịa chỉ: Thiên Sơn Suối Ngà, Vân Hoà, Ba Vì, Hà Nội https://goo.gl/maps/HQ6p6f1eSy7YeZ3p9\nĐiểm chất ngất trong khu du lịch là thác Cổng Trời mênh mông và bao la. Từ độ cao vài chục mét có 3 làn nước đổ xuống sườn núi tạo thành một bể bơi thiên nhiên. Nước suối trong veo, nhìn thấy cả hạt cát dưới đáy.\n6️⃣ DU LỊCH TÂM LINH ĐỀN THƯỢNG:\nĐịa chỉ: Vườn Quốc gia Ba Vì, xã Ba Vì, huyện Ba Vì, Hà Nội.\nhttps://maps.app.goo.gl/QGouKkeciDr6FxLw8\nĐền Thượng Ba Vì là địa điểm du lịch tâm linh mà du khách không thể bỏ lỡ nếu có chuyến du lịch Ba Vì. Ngôi đền tọa lạc trên núi cao giúp du khách vừa ghé hành hương vừa được chiêm ngưỡng cảnh vật xung quanh. Nơi đây là một nơi huyền bí, có thăm thẳm độ sâu về tâm linh. Thờ Đức Thánh Tản, Đức Thánh Trần, Thánh mẫu Cửu Trùng Thiên, một vị thánh sinh ra vạn vật, muôn loài (theo tín ngưỡng Thánh Mẫu của người Việt cổ)\n7️⃣ DU LỊCH TÂM LINH ĐỀN TRUNG:\nĐịa chỉ: xã Khánh Thượng, huyện Ba Vì Hà Nội.\nhttps://g.co/kgs/CmWCb4\nĐền Trung hay còn gọi là Trung Cung. Theo cuốn Ngọc Phả \"Sự tích Đức Thánh Tản\" lưu giữ tại Đền Và (Đông Cung) do Quản giám bách thân Nguyễn Hiển sao lại năm Vĩnh Hựu thứ 3 (1737) có ghi: Đền Trung là nơi thờ bà Ma Thị Cao Sơn, mẹ nuôi của Đức Thánh Tản Viên.\n8️⃣ DU LỊCH TÂM LINH ĐỀN HẠ:\nĐịa chỉ: Xã Minh Quang, Huyện Ba Vì Hà Nội.\nhttps://g.co/kgs/5aotcp\nĐền Hạ còn gọi là Tây Cung hay Đền Năm dân, Đền tọa lạc ở một bãi đất bằng phẳng dưới chân núi Tản ven bờ sông Đà thuộc địa phận tổng Thủ Pháp xưa. Đền thờ Tam vị Đức Thánh Tản.\n9️⃣ DU LỊCH SINH THÁI THÁC ĐA: \nĐịa chỉ: Khu Du Lịch Thác Đa, Vân Hoà, Ba Vì, Hà Nội https://goo.gl/maps/ujNCkSS5zjKao2tz7\nLà điểm du lịch gần với trung tâm HN, Ba Vì mang trong mình sự yên bình, tĩnh lặng cùng khung cảnh nên thơ tuyệt vời. Ngoài việc nổi tiếng bởi những danh lam thắng cảnh hoang sơ với những lễ hội, ẩm thực và văn hoá độc đáo của người dân Tộc bản địa phương.\n? DU LỊCH SINH THÁI LONG VIỆT:\nĐịa chỉ: Khu Du lịch sinh thái Long Việt\nThôn Nghe, Ba Vì, Hà Nội https://goo.gl/maps/AYgf3BEAnGK1TbEW7\nVới không gian xanh, sạch, là nơi lý tưởng và đầy thú vị cho những buổi dã ngoại của gia đình cùng bạn bè thưởng thức và thư giãn giữa không gian bao la vùng núi Ba Vì.\nLet\'s goo ?\nHành trình khám phá Ba Vì sắp tới chắc chắn sẽ có nhiều điều hấp dẫn đang chờ đón bạn. Lên lịch đi chơi thôi!! ','','Kn Ba Vì_2_Các điểm du lịch ở Ba Vì',0,0,0,0,0,0,NULL,0,0,0,'',NULL,NULL),(229,'#homestay6p',29,1,0,0,0,'?MoLLy?\nhttps://youtu.be/DBNN8e3_sPg\n_5p+1gác_2tầng_20-30ng (cả trẻ em)_in14h_out12h\nhttp://bit.ly/0911858998_MoLLy_0966758689\nTọa lạc tại khu đất 4.500m2 trên đỉnh đồi:\n? 3pn khép kín: 1 giường King\n? 2pn khép kín: 2 giường Queen\n? 1pn gác xép: 2 đệm Queen\n? Đệm dự phòng 1m4 và sofa giường ở phòng khách khi cần.\n?? Mỗi phòng đều được trang bị khăn tắm, dầu gội đầu, sữa tắm; \n?? Bếp và đồ dùng nấu bếp đầy đủ, tiện nghi;\n?? Sân BBQ và bếp ướt cùng khu chuẩn bị nướng.\n?Bể bơi người lớn (Bể to 72m, Sâu 1m2) và bể vầy trẻ em\n?Sân cỏ chơi team building\n?Khu vui chơi trẻ em ngoài trời\n?Lò sưởi trong nhà và khu sưởi ngoài trời\n?Khu đốt lửa trại (đốt tại vị trí quy định):\n- Combo gói đốt lửa trại + 1 gà đắp đất nướng: 500k\n- Combo gói đốt lửa trại + ngô, khoai nướng: 350k\n- Đốt lửa trại ( gồm củi, nhóm lửa và dọn dẹp): 300k\n- Đốt lửa sưởi tại khu sưởi ngoài trời (gồm củi, nhóm lửa và dọn dẹp): 200k\n?P.karaoke có hệ thống loa, âm ly và bảng điều khiển: 500k/đêm\n?Loa kéo + 2micro: 300k\n?1Khay nổi bể bơi: 200k/lượt\n?Dv dọn dẹp, rửa bát: 200k-300k/lượt (tùy vào slg người, đồ nhiều hay ít => quản gia sẽ báo giá)\n?Dịch vụ BBQ: \n- Gồm: b